import React from 'react'
import {useLocation} from 'react-router-dom';

function ReviewState(props) {
        const location = useLocation()
        return (
            <div>
                <h1>Hi!</h1>
                <div>{location.state.name}</div>
            </div>
            
          )
}

export default ReviewState
